            <Fragment>
                <div className = 'container'>
                    <div class= 'row justify-content-md-center col-lg-12' id = 'mainInfo'>
                       <div className = 'col-xs-12 col-lg-3 ' id = 'profilePicture'>
                           <div id = 'avatar'></div>
                       </div>
                        <div className = 'col-xs-12 col-lg-3 ' id = 'profileDescription' >
                            <p id = 'userName'> user name </p>
                            <span className = 'userNick'>@</span><span className = 'userNick'>usernick</span>
                            <p> <input type = 'text' placeholder = 'your description' id = 'descInput'/> </p>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default UserProfile;
